function evalExp (s)
   latency = -1.0
   for i = 0, 5 do
      local t1 = os.clock()
      local t = lpeg.match(G, s)
      local e1 = os.clock() - t1
      -- print("elapsedTime: ", e1)
      if latency == -1.0 or latency > e1 then
        latency = e1
      end
      if not t then error("syntax error", 2) end
      if (string.len(s) > t) then error("unconsume", 2) end
   end
   return (latency * 1000.0)
end

fileName = arg[1]
fh, msg = io.open(fileName, "r")
if fh then
   data = fh:read("*a")
else
   print(msg)
end
latency = evalExp(data)
-- print("input, latency[ms]")
print(fileName..", "..latency)
